import React from 'react';
import { Box, BoxExtendedProps, Grommet } from 'grommet';
import logo from "./icon_sber-01.png";
import './App.css';

// const App: React

const theme = {
  global: {
    colors: {
      brand: '#2ff22e',
    },
    font: {
      family: 'Roboto',
      size: '20px',
      height: '20px',
      weight: 'bold',
      color: '#2ff22e',
    },
  },
};

const AppBarPre = (props: JSX.IntrinsicAttributes & BoxExtendedProps) => (
  <Box
    tag='header'
    direction='row'
    align='center'
    justify='between'
    background='#2ef22e'
    pad={{ left: 'medium', right: 'small', vertical: 'small' }}
    elevation='medium'
    style={{ zIndex: '1' }}
    // color='#FFFFFF'
    {...props}
  />
);

const AppBar = (props: JSX.IntrinsicAttributes & BoxExtendedProps) => (
  <Box
    tag='header'
    direction='row'
    align='center'
    justify='between'
    background='white'
    pad={{ left: 'medium', right: 'small', vertical: 'small' }}
    elevation='medium'
    style={{ zIndex: '1' }}
    {...props}
  />
);

function App() {
  return (
    <Grommet theme={theme}>
      {/* <header className="App-header">
        <p>
          Edit <code>src/App.tsx</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
      {/* title={<img src=""/>} */}
      <AppBarPre ></AppBarPre>
      <AppBar> <img src={logo} alt="logo" width="30px"/> POWERED BY ALINA</AppBar>
    </Grommet>
  );
}

export default App;
